  console.log(`\nðŸ§ª Testing ${provider.toUpperCase()} validation:`);
  console.log('â”€'.repeat(50));

  let passed = 0;
  let failed = 0;

  // Test valid cases
  if (cases.valid) {
    Object.entries(cases.valid).forEach(([testName, value]) => {
      try {
        const result = apiKeyService.validateApiKeyFormat(
          provider, 
          value, 
          testName === 'secretKey' ? null : cases.valid.secretKey
        );

        if (result.valid) {
          console.log(`   âœ… Valid ${testName}: PASS`);
          passed++;
        } else {
          console.log(`   âŒ Valid ${testName}: FAIL - ${result.error}`);
          failed++;
        }
      } catch (error) {
        console.log(`   ðŸ’¥ Valid ${testName}: ERROR - ${error.message}`);
        failed++;
      }
    });
