  // Test invalid cases
  if (cases.invalid) {
    Object.entries(cases.invalid).forEach(([testName, value]) => {
      try {
        const result = apiKeyService.validateApiKeyFormat(
          provider, 
          value, 
          testName.includes('secret') ? null : cases.valid?.secretKey
        );

        if (!result.valid) {
          console.log(`   âœ… Invalid ${testName}: PASS (correctly rejected)`);
          passed++;
        } else {
          console.log(`   âŒ Invalid ${testName}: FAIL (should be rejected)`);
          failed++;
        }
      } catch (error) {
        console.log(`   ðŸ’¥ Invalid ${testName}: ERROR - ${error.message}`);
        failed++;
      }
    });
