  // Test placeholder cases
  if (cases.placeholder) {
    Object.entries(cases.placeholder).forEach(([testName, value]) => {
      try {
        const result = apiKeyService.validateApiKeyFormat(provider, value);

        if (!result.valid && result.errorCode === 'PLACEHOLDER_VALUE') {
