  const total = passed + failed;
  const successRate = total > 0 ? ((passed / total) * 100).toFixed(1) : 0;
  console.log(`\n   ðŸ“Š ${provider.toUpperCase()} Results: ${passed}/${total} passed (${successRate}%)`);

  return { passed, failed, total };
